import styled from "styled-components";

const Containter = styled.div``;
const Header = styled.div``;
const CoinsList = styled.ul``;
const Coin = styled.li``;
const Title = styled.div`
  color: ${(props) => props.theme.accentColor};
`;

const coins = [
  {
    id: "btc-bitcoin",
    name: "Bitcoin",
    symbol: "BTC",
    rank: 1,
    is_new: false,
    is_active: true,
    type: "coin",
  },
  {
    id: "eth-ethereum",
    name: "Ethereum",
    symbol: "ETH",
    rank: 2,
    is_new: false,
    is_active: true,
    type: "coin",
  },
  {
    id: "hex-hex",
    name: "HEX",
    symbol: "HEX",
    rank: 3,
    is_new: false,
    is_active: true,
    type: "token",
  },
];

function Coins() {
  return (
    <Containter>
      <Header>
        <Title>Coin</Title>
      </Header>
      <CoinsList>{coins.map((coin) => coin.name)}</CoinsList>
    </Containter>
  );
}

export default Coins;
